// Embedded single-file index.html
export const EMBEDDED_ASSETS = { '/': { contentType: 'text/html', base64: `` } };

function decodeBase64ToUint8Array(b64) {
  const binary = atob(b64);
  const arr = new Uint8Array(binary.length);
  for (let i = 0; i < binary.length; i++) arr[i] = binary.charCodeAt(i);
  return arr;
}

export function getEmbeddedAsset(path) {
  if (path === '/') path = '/';
  const asset = EMBEDDED_ASSETS[path];
  if (!asset) return null;
  const bytes = decodeBase64ToUint8Array(asset.base64);
  return new Response(bytes, { headers: { 'Content-Type': asset.contentType } });
}
